We have now done all the steps necessary to intersect the 10X single-cell sequencing data with the enrichment PCR. We can now just load in the 10X sequencing data and merge the dataframes together to have our cells assigned to their respective sgRNAs. The next step will assume you have scanpy installed already. import pandas as pd
import scanpy as sc # load assignments
assignments = pd.read_csv( "meta/assignment/sampleX.tab", sep="\t", index_col="barcode"
) # load anndata (10X)
adata = sc.read( "alignment/10x/sampleX/counts_filtered/adata.h5ad"
) # merge the two
adata.obs = adata.obs.merge( assignment, left_index=True, right_index=True, how="left"
) # drop cells that do not have an assignment
adata = adata.obs[~adata.obs.guide.isna()].copy() # view the merged anndata
adata
